window.bookSummaryJSON = "<p>\"Are you in a bad mood or something?\" asked Rocky. \"Or something,\" said Judy Moody. Bad moods, good moods, even back-to-school moods - Judy Moody has them all! When her teacher assigns the class the task of creating \"Me\" collages, it puts Judy in a cut-and-paste mood! Meet Judy Moody, her little \"bother\" Stink, her best friend Rocky, and her \"pest\" friend Frank Pearl. They're guaranteed to put you in a very Judy Moody mood... or something. </p>"; 
